import { useState, useEffect } from "react";


function Men({children}) {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    items()
  }, [])

  // Fetched items
  const items = async () => {
    const res = await fetch(`https://fakestoreapi.com/products/3`)
    const data = await res.json()

    setProducts(data)
  } 
const Display = () => {
  return (
    <div className="boxes">    
      <div key={products.id} className="box">
      <img src={`${products.image }`} alt="" className="img" />
      <p>{products.title}</p>
      </div>
      </div>
  )
}

return (
    <div>
      <h1>Category</h1>
      <div className="boxes"> 
        <Display />
        <Display />
